import React from 'react';
import "./home.css"
import image1 from './images/1.jpg';
import image2 from '../src/images/3.jpg';
import image3 from '../src/images/4.jpg';
import image4 from '../src/images/5.jpg';
import image5 from '../src/images/6.jpg';
import backgroundImage from '../src/images/christian-christianity-religion-background_1421-12.avif';
const data = [
  { image1: "/images/1.jpg", title: "Noah's Ark" },
  { image2: "/images/3.jpg", title: "Noah's Ark" },
  { image3: "/images/4.jpg", title: "Bible" },
  { image4: "/images/5.jpg", title: "Christian" },
  { image5: "/images/6.jpg", title: "Pray" }
];


function Home() {
  return (
    <img src='./images/christian-christianity-religion-background_1421-12.avif' alt='111'></img>,
    <div className='h-screen bg-slate-600 pt-10'>
      <div className='h'>
        {
          data.map((item, index) => (
            <div key={index} className='mb-4'>
              <img src={item.image} alt={item.title} className='w-40 ' />
              <div className='p-6'>
                <p className='font-semibold'>{item.title}</p>
              </div>
            </div>
          ))
        }
      </div>
    </div>
  );
}

export default Home;
